import { ListList } from "../testData/FoodData";
import { MyListElementContent } from "./MyListElementContent";

export const MyListsElementBox = (data: any, setData: any, setPopup: any) => {
  return (
    <>
      {ListList.map((item) => (
        <MyListElementContent
          item={item}
          setData={setData}
          setPopup={setPopup}
        />
      ))}
    </>
  );
};
